import React from 'react'

//accept props here

const List = (props) => {
    const { people } = props

    //mapping over prop 'people'
    return people.map((person) => {
        const { id, name, age, image } = person
        return (<article key={id} className='person'>

            <img src={image} alt={name} />

            <div>
                <h4>{name}</h4>
                <p>{age} years</p>
            </div>

        </article>
        )
    })
}

export default List
